  [],\n\t\"revision_timestamp\": \"2015-05-06T21:12:51.818736\",\n\t\"name\": \"development-of-fast-response-sme-tini-foam-torque-tubes-project-bdc3b\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In Phase I, Shape Change Technologies had
  developed a process to manufacture net shape TiNi foam torque tubes that demonstrated
  the shape memory effect. The torque tubes dramatically reduce the response time
  by a factor of 10 and with integrated hexagonal ends, make structural connections
  fascile. In Phase II we see to mature this actuator technology by rigorously  characterizing
  the process to optimize the quality of the TiNi and develop a set of metrics to
  provide ISO 9002 quality assurance. With the rapid response time, a Labview based
  real time control of the torsional actuators will be developed.  With team partner
  Boeing, we will develop these actuators for aerospace applications and Boeing will
  independently characterize the actuators. \",\n\t\"license_title\": \"U.S. Government
